import React from "react";
import CardItem from "./CardItem";
import "./Cards.css";
let data = require("./data/Discord_final_output.json");

function Cards() {

  console.log(data);
  return (
    <div className="cards">
      <div className="cards__container">
        <div className="cards__wrapper">
          <ul className="cards__items">
          {data.map((card) => {
            <CardItem
              src={card.nft_pic}
              text={card.project_name}
              path="project"
            />
          })}
            <CardItem
              src={data[0].nft_pic}
              text={data[0].project_name}
              path="/project-1"
            />
            <CardItem
              src="images/img-2.jpeg"
              text="The Colosseum, Rome"
              label="Italy"
              path="/sign-in"
            />
          </ul>
          <ul className="cards__items">
            <CardItem
              src="images/img-3.jpeg"
              text="The Great Pyramids, Giza"
              label="Egypt"
              path="/sign-in"
            />
            <CardItem
              src="images/img-4.jpeg"
              text="Machu Picchu, Cordillera"
              label="Peru"
              path="/sign-in"
            />
            <CardItem
              src="images/img-5.jpeg"
              text="The Acropolis, Athens"
              label="Greece"
              path="/sign-in"
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
